atom-text-editor .gutter .line-number.split-diff-added,
atom-text-editor .line.split-diff-added {
  background-color: rgba(195, 232, 141, 0.4);
}
atom-text-editor .gutter .line-number.split-diff-removed,
atom-text-editor .line.split-diff-removed {
  background-color: rgba(240, 113, 120, 0.4);
}
atom-text-editor .gutter .line-number.split-diff-selected,
atom-text-editor .line.split-diff-selected {
  background-color: rgba(255, 203, 107, 0.4);
}
atom-text-editor .split-diff-word-added .region {
  background-color: rgba(195, 232, 141, 0.5);
}
atom-text-editor .split-diff-word-removed .region {
  background-color: rgba(240, 113, 120, 0.5);
}
atom-text-editor .split-diff-offset {
  background-color: #141414;
}
/* loading modal */
@keyframes delay-modal {
  0% {
    opacity: 0;
  }
  99% {
    opacity: 0;
  }
  100% {
    opacity: 1;
  }
}
.split-diff-hide-mask {
  animation: delay-modal 1s forwards;
}
.split-diff-modal {
  padding: 14px;
  text-align: center;
}
.split-diff-message {
  font-size: 26px;
  display: inline-block;
}
.split-diff-icon {
  background-image: url('images/octocat-spinner-128.gif');
  background-repeat: no-repeat;
  background-size: contain;
  width: 40px;
  height: 40px;
  display: inline-block;
}
.split-diff-hide-mask:after {
  display: none;
}
/* bottom panel UI */
.split-diff-ui {
  padding: 2px 10px 2px 10px;
  display: flex;
  justify-content: space-between;
