}
.split-diff-ui .left {
  width: 300px;
}
.split-diff-ui .mid {
  text-align: center;
}
.split-diff-ui .right {
  display: flex;
  width: 300px;
}
.split-diff-ui .num-diff,
.split-diff-ui .selection-count,
.split-diff-ui .selection-divider,
.split-diff-ui .num-diff-text {
  display: inline-block;
  margin-left: 0.5em;
  font-size: 1rem;
}
.split-diff-ui .selection-count,
.split-diff-ui .num-diff {
  vertical-align: middle;
}
.split-diff-ui .copy-to-left::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f035";
}
.split-diff-ui .copy-to-right::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f035";
}
.split-diff-ui .copy-to-right:before {
  transform: scaleX(-1);
}
.split-diff-ui .prev-diff::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f0a2";
}
.split-diff-ui .next-diff::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f0a3";
}
.split-diff-ui .prev-diff,
.split-diff-ui .next-diff,
.split-diff-ui .copy-to-left {
  margin-right: 0.5rem;
}
.split-diff-ui .ignore-whitespace-label {
  align-self: center;
  margin-left: auto;
  margin-bottom: 0;
  cursor: pointer;
  padding-right: 4px;
}
.split-diff-ui input[type=checkbox] {
  display: none;
}
.split-diff-ui input[type=checkbox] + label:before {
  content: '\f081';
}
.split-diff-ui input[type=checkbox]:checked + label:before {
  content: '\f03a';
}
.split-diff-ui label:before {
  font-family: 'Octicons Regular';
  display: inline-block;
  cursor: pointer;
  padding: 0 0.5rem;
  font-size: 1rem;
  margin-right: 0.5rem;
}
.git-time-machine .timeplot .placeholder {
  height: 100px;
  text-align: center;
  vertical-align: middle;
}
.git-time-machine .close-handle {
  position: absolute;
  top: 3px;
  right: 4px;
  border: 1px solid #BBB;
  display: inline-block;
  border-radius: 14px;
  /* background-color: red; */
  font-size: 13px;
  margin-right: 12px;
  margin-top: 4px;
  cursor: pointer;
  z-index: 4;
}
.git-time-machine .close-handle:hover {
  background-color: red;
}
.git-time-machine .stats {
  display: inline-block;
  float: left;
  margin-top: 3px;
}
.git-time-machine .axis path,
.git-time-machine .axis line {
  fill: none;
  stroke: #eee;
  shape-rendering: crispEdges;
}
.git-time-machine .axis text {
  font-family: sans-serif;
  font-size: 11px;
  fill: rgba(221, 221, 221, 0.35);
}
.git-time-machine .loading {
  font-family: sans-serif;
  font-size: 15px;
}
.git-time-machine .circle {
  fill: #DDDDDD;
  opacity: .3;
}
.git-time-machine .hover-marker {
  position: absolute;
  height: calc(100% - 25px);
  width: 5px;
  top: 0px;
  right: 10px;
  background-color: transparent;
}
.git-timemachine-popup {
  background: #212121;
  color: rgba(221, 221, 221, 0.65);
}
.git-timemachine-popup.popover-list {
  position: absolute;
  z-index: 10;
  width: 400px;
  max-height: 300px;
  overflow-y: auto;
  border: solid 4px transparent;
}
.git-timemachine-popup .controls {
  float: right;
}
.git-timemachine-popup ul {
  list-style-type: none;
}
.git-timemachine-popup li .commit {
  background-color: #212121;
  margin-left: -35px;
  margin-bottom: 4px;
  padding: 3px 4px;
  white-space: pre-wrap;
}
.git-timemachine-popup li .commit:hover {
  background-color: #009688;
}
.git-timemachine-popup li .commit > div {
  margin-bottom: 4px;
}
.git-timemachine-popup li .commit .header {
  width: 100%;
  overflow: hidden;
}
.git-timemachine-popup li .commit .header > div {
  display: inline-block;
  width: 30%;
}
